import styled from 'styled-components'

export const LegalModal = styled.div`
    width: 500px;
    height: 550px;
    background: white;
    border: 1px solid black;
    border-radius: 5px;
    padding: 20px;
    position: relative;
    margin: 0 auto;
    top: 20%;
`;
